import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header>GetWord</header>
      <h1>score: 10</h1>
      <div className="gameContainer">
        <div className="timer">32</div>
        <label className="word">emperor</label>
        <input className="input" placeholder="type to start game"></input>
        <button></button>
      </div>
    </div>
  );
}

export default App;
